import { useEffect, useState } from "react";
import { getMe } from "../api";

const Profile = (props) => {
const [myProfile, setMyProfile] = useState([])

    useEffect(() => {
        getMe().then(result=>{
          setMyProfile(result)
          console.log(result)
        }).catch(error=>{
          console.error(error)
        })}, []); 
    return (
        <div>
        <h1>Profile</h1>
        <p>messages</p>
        {myProfile.data.messages ? myProfile.data.messages.map(messages => <p>{messages}</p>):
        <p>no messages</p>}
        </div>
    )
}


export default Profile
